import React from 'react';
import "../Css/Banner.css"
import anh1 from '../img/imageprj.png'
const Banner = () => {
    return (
        <div>
            <div className="content">
                <img src={anh1}></img>
            </div>
        </div>
    );
}

export default Banner;
